    render(){
      let icon = <FontAwesomeIcon icon={faLinkedin} />
      console.log(icon)
      return(
        <div>
          <div id="backGroundPhotoContact">
            <img id="worldBackGroundContact" src="worldBackGroundContact.jpg"></img>
