            <div id="logoBrandingBoxLeft">
              <div id="logoBrandingBoxLeftTitle">Revenue3</div>
              <div id="logoBrandingBoxLeftLogoPhoto"></div>
              <div id="logoBrandingBoxLeftLogoContent">Your inside source for crypto-native GTM talent</div>
